import React from 'react'
import './BeforeAfter.css'

export const BeforeAfter = (props) => {
  return (
    <div className="before-after-container">
      <div
        style={{
          backgroundImage: `url(${props.beforeBackground})`,
          backgroundPosition: 'bottom',
          backgroundSize: 'cover',
          backgroundRepeat: 'no-repeat',
        }}
        className="before-background"
      >
        <div className="before-image">
          <img
            className={'image' + ' ' + props.borderRadius}
            src={props.beforeImage}
            alt=""
          />
        </div>
      </div>

      <div
        style={{
          backgroundImage: `url(${props.afterBackground})`,
          backgroundPosition: 'bottom',
          backgroundSize: 'cover',
          backgroundRepeat: 'no-repeat',
        }}
        className="after-background"
      >
        <div className="before-image">
          <img
            className={'image' + ' ' + props.borderRadius}
            src={props.afterImage}
            alt=""
          />
        </div>
      </div>
    </div>
  )
}
